import { mkdirpManual, mkdirpManualSync } from './mkdirp-manual.js'
import { mkdirpNative, mkdirpNativeSync } from './mkdirp-native.js'
import { MkdirpOptions, optsArg } from './opts-arg.js'
import { pathArg } from './path-arg.js'
import { useNative, useNativeSync } from './use-native.js'
/* c8 ignore start */
export { mkdirpManual, mkdirpManualSync } from './mkdirp-manual.js'
export { mkdirpNative, mkdirpNativeSync } from './mkdirp-native.js'
export { useNative, useNativeSync } from './use-native.js'
/* c8 ignore stop */

export const mkdirpSync = (path: string, opts?: MkdirpOptions) => {
  path = pathArg(path)
  const resolved = optsArg(opts)
  return useNativeSync(resolved)
    ? mkdirpNativeSync(path, resolved)
    : mkdirpManualSync(path, resolved)
}

export const sync = mkdirpSync
export const manual = mkdirpManual
export const manualSync = mkdirpManualSync
export const native = mkdirpNative
export const nativeSync = mkdirpNativeSync
export const mkdirp = Object.assign(
  async (path: string, opts?: MkdirpOptions) => {
    path = pathArg(path)
    const resolved = optsArg(opts)
    return useNative(resolved)
      ? mkdirpNative(path, resolved)
      : mkdirpManual(path, resolved)
  },
  {
    mkdirpSync,
    mkdirpNative,
    mkdirpNativeSync,
    mkdirpManual,
    mkdirpManualSync,

    sync: mkdirpSync,
    native: mkdirpNative,
    nativeSync: mkdirpNativeSync,
    manual: mkdirpManual,
    manualSync: mkdirpManualSync,
    useNative,
    useNativeSync,
  }
)

import { dirname } from 'path'
import { MkdirpOptions, optsArg } from './opts-arg.js'

export const mkdirpManualSync = (
  path: string,
  options?: MkdirpOptions,
  made?: string | undefined | void
): string | undefined | void => {
  const parent = dirname(path)
  const opts = { ...optsArg(options), recursive: false }

  if (parent === path) {
    try {
      return opts.mkdirSync(path, opts)
    } catch (er) {
      // swallowed by recursive implementation on posix systems
      // any other error is a failure
      const fer = er as NodeJS.ErrnoException
      if (fer && fer.code !== 'EISDIR') {
        throw er
      }
      return
    }
  }

  try {
    opts.mkdirSync(path, opts)
    return made || path
  } catch (er) {
    const fer = er as NodeJS.ErrnoException
    if (fer && fer.code === 'ENOENT') {
      return mkdirpManualSync(path, opts, mkdirpManualSync(parent, opts, made))
    }
    if (fer && fer.code !== 'EEXIST' && fer && fer.code !== 'EROFS') {
      throw er
    }
    try {
      if (!opts.statSync(path).isDirectory()) throw er
    } catch (_) {
      throw er
    }
  }
}

export const mkdirpManual = Object.assign(
  async (
    path: string,
    options?: MkdirpOptions,
    made?: string | undefined | void
  ): Promise<string | undefined | void> => {
    const opts = optsArg(options)
    opts.recursive = false
    const parent = dirname(path)
    if (parent === path) {
      return opts.mkdirAsync(path, opts).catch(er => {
        // swallowed by recursive implementation on posix systems
        // any other error is a failure
        const fer = er as NodeJS.ErrnoException
        if (fer && fer.code !== 'EISDIR') {
          throw er
        }
      })
    }

    return opts.mkdirAsync(path, opts).then(
      () => made || path,
      async er => {
        const fer = er as NodeJS.ErrnoException
        if (fer && fer.code === 'ENOENT') {
          return mkdirpManual(parent, opts).then(
            (made?: string | undefined | void) => mkdirpManual(path, opts, made)
          )
        }
        if (fer && fer.code !== 'EEXIST' && fer.code !== 'EROFS') {
          throw er
        }
        return opts.statAsync(path).then(
          st => {
            if (st.isDirectory()) {
              return made
            } else {
              throw er
            }
          },
          () => {
            throw er
          }
        )
      }
    )
  },
  { sync: mkdirpManualSync }
)

import { dirname } from 'path'
import { findMade, findMadeSync } from './find-made.js'
import { mkdirpManual, mkdirpManualSync } from './mkdirp-manual.js'
import { MkdirpOptions, optsArg } from './opts-arg.js'

export const mkdirpNativeSync = (
  path: string,
  options?: MkdirpOptions
): string | void | undefined => {
  const opts = optsArg(options)
  opts.recursive = true
  const parent = dirname(path)
  if (parent === path) {
    return opts.mkdirSync(path, opts)
  }

  const made = findMadeSync(opts, path)
  try {
    opts.mkdirSync(path, opts)
    return made
  } catch (er) {
    const fer = er as NodeJS.ErrnoException
    if (fer && fer.code === 'ENOENT') {
      return mkdirpManualSync(path, opts)
    } else {
      throw er
    }
  }
}

export const mkdirpNative = Object.assign(
  async (
    path: string,
    options?: MkdirpOptions
  ): Promise<string | void | undefined> => {
    const opts = { ...optsArg(options), recursive: true }
    const parent = dirname(path)
    if (parent === path) {
      return await opts.mkdirAsync(path, opts)
    }

    return findMade(opts, path).then((made?: string | undefined) =>
      opts
        .mkdirAsync(path, opts)
        .then(m => made || m)
        .catch(er => {
          const fer = er as NodeJS.ErrnoException
          if (fer && fer.code === 'ENOENT') {
            return mkdirpManual(path, opts)
          } else {
            throw er
          }
        })
    )
  },
  { sync: mkdirpNativeSync }
)

import {
  MakeDirectoryOptions,
  mkdir,
  mkdirSync,
  stat,
  Stats,
  statSync,
} from 'fs'

export interface FsProvider {
  stat?: (
    path: string,
    callback: (err: NodeJS.ErrnoException | null, stats: Stats) => any
  ) => any
  mkdir?: (
    path: string,
    opts: MakeDirectoryOptions & { recursive?: boolean },
    callback: (err: NodeJS.ErrnoException | null, made?: string) => any
  ) => any
  statSync?: (path: string) => Stats
  mkdirSync?: (
    path: string,
    opts: MakeDirectoryOptions & { recursive?: boolean }
  ) => string | undefined
}

interface Options extends FsProvider {
  mode?: number | string
  fs?: FsProvider
  mkdirAsync?: (
    path: string,
    opts: MakeDirectoryOptions & { recursive?: boolean }
  ) => Promise<string | undefined>
  statAsync?: (path: string) => Promise<Stats>
}

export type MkdirpOptions = Options | number | string

export interface MkdirpOptionsResolved {
  mode: number
  fs: FsProvider
  mkdirAsync: (
    path: string,
    opts: MakeDirectoryOptions & { recursive?: boolean }
  ) => Promise<string | undefined>
  statAsync: (path: string) => Promise<Stats>
  stat: (
    path: string,
    callback: (err: NodeJS.ErrnoException | null, stats: Stats) => any
  ) => any
  mkdir: (
    path: string,
    opts: MakeDirectoryOptions & { recursive?: boolean },
    callback: (err: NodeJS.ErrnoException | null, made?: string) => any
  ) => any
  statSync: (path: string) => Stats
  mkdirSync: (
    path: string,
    opts: MakeDirectoryOptions & { recursive?: boolean }
  ) => string | undefined
  recursive?: boolean
}

export const optsArg = (opts?: MkdirpOptions): MkdirpOptionsResolved => {
  if (!opts) {
    opts = { mode: 0o777 }
  } else if (typeof opts === 'object') {
    opts = { mode: 0o777, ...opts }
  } else if (typeof opts === 'number') {
    opts = { mode: opts }
  } else if (typeof opts === 'string') {
    opts = { mode: parseInt(opts, 8) }
  } else {
    throw new TypeError('invalid options argument')
  }

  const resolved = opts as MkdirpOptionsResolved
  const optsFs = opts.fs || {}

  opts.mkdir = opts.mkdir || optsFs.mkdir || mkdir

  opts.mkdirAsync = opts.mkdirAsync
    ? opts.mkdirAsync
    : async (
        path: string,
        options: MakeDirectoryOptions & { recursive?: boolean }
      ): Promise<string | undefined> => {
        return new Promise<string | undefined>((res, rej) =>
          resolved.mkdir(path, options, (er, made) =>
            er ? rej(er) : res(made)
          )
        )
      }

  opts.stat = opts.stat || optsFs.stat || stat
  opts.statAsync = opts.statAsync
    ? opts.statAsync
    : async (path: string) =>
        new Promise((res, rej) =>
          resolved.stat(path, (err, stats) => (err ? rej(err) : res(stats)))
        )

  opts.statSync = opts.statSync || optsFs.statSync || statSync
  opts.mkdirSync = opts.mkdirSync || optsFs.mkdirSync || mkdirSync

  return resolved
}

const platform = process.env.__TESTING_MKDIRP_PLATFORM__ || process.platform
import { parse, resolve } from 'path'
export const pathArg = (path: string) => {
  if (/\0/.test(path)) {
    // simulate same failure that node raises
    throw Object.assign(
      new TypeError('path must be a string without null bytes'),
      {
        path,
        code: 'ERR_INVALID_ARG_VALUE',
      }
    )
  }

  path = resolve(path)
  if (platform === 'win32') {
    const badWinChars = /[*|"<>?:]/
    const { root } = parse(path)
    if (badWinChars.test(path.substring(root.length))) {
      throw Object.assign(new Error('Illegal characters in path.'), {
        path,
        code: 'EINVAL',
      })
    }
  }

  return path
}

import { mkdir, mkdirSync } from 'fs'
import { MkdirpOptions, optsArg } from './opts-arg.js'

const version = process.env.__TESTING_MKDIRP_NODE_VERSION__ || process.version
const versArr = version.replace(/^v/, '').split('.')
const hasNative = +versArr[0] > 10 || (+versArr[0] === 10 && +versArr[1] >= 12)

export const useNativeSync = !hasNative
  ? () => false
  : (opts?: MkdirpOptions) => optsArg(opts).mkdirSync === mkdirSync

export const useNative = Object.assign(
  !hasNative
    ? () => false
    : (opts?: MkdirpOptions) => optsArg(opts).mkdir === mkdir,
  {
    sync: useNativeSync,
  }
)

import { dirname } from 'path'
import { MkdirpOptionsResolved } from './opts-arg.js'

export const findMade = async (
  opts: MkdirpOptionsResolved,
  parent: string,
  path?: string
): Promise<undefined | string> => {
  // we never want the 'made' return value to be a root directory
  if (path === parent) {
    return
  }

  return opts.statAsync(parent).then(
    st => (st.isDirectory() ? path : undefined), // will fail later
    er => {
      const fer = er as NodeJS.ErrnoException
      return fer && fer.code === 'ENOENT'
        ? findMade(opts, dirname(parent), parent)
        : undefined
    }
  )
}

export const findMadeSync = (
  opts: MkdirpOptionsResolved,
  parent: string,
  path?: string
): undefined | string => {
  if (path === parent) {
    return undefined
  }

  try {
    return opts.statSync(parent).isDirectory() ? path : undefined
  } catch (er) {
    const fer = er as NodeJS.ErrnoException
    return fer && fer.code === 'ENOENT'
      ? findMadeSync(opts, dirname(parent), parent)
      : undefined
  }
}

// Note: since nyc uses this module to output coverage, any lines
// that are in the direct sync flow of nyc's outputCoverage are
// ignored, since we can never get coverage for them.
// grab a reference to node's real process object right away
import { signals } from './signals.js'
export { signals }

// just a loosened process type so we can do some evil things
type ProcessRE = NodeJS.Process & {
  reallyExit: (code?: number | undefined | null) => any
  emit: (ev: string, ...a: any[]) => any
}

const processOk = (process: any): process is ProcessRE =>
  !!process &&
  typeof process === 'object' &&
  typeof process.removeListener === 'function' &&
  typeof process.emit === 'function' &&
  typeof process.reallyExit === 'function' &&
  typeof process.listeners === 'function' &&
  typeof process.kill === 'function' &&
  typeof process.pid === 'number' &&
  typeof process.on === 'function'

const kExitEmitter = Symbol.for('signal-exit emitter')
const global: typeof globalThis & { [kExitEmitter]?: Emitter } = globalThis
const ObjectDefineProperty = Object.defineProperty.bind(Object)

/**
 * A function that takes an exit code and signal as arguments
 *
 * In the case of signal exits *only*, a return value of true
 * will indicate that the signal is being handled, and we should
 * not synthetically exit with the signal we received. Regardless
 * of the handler return value, the handler is unloaded when an
 * otherwise fatal signal is received, so you get exactly 1 shot
 * at it, unless you add another onExit handler at that point.
 *
 * In the case of numeric code exits, we may already have committed
 * to exiting the process, for example via a fatal exception or
 * unhandled promise rejection, so it is impossible to stop safely.
 */
export type Handler = (
  code: number | null | undefined,
  signal: NodeJS.Signals | null
) => true | void
type ExitEvent = 'afterExit' | 'exit'
type Emitted = { [k in ExitEvent]: boolean }
type Listeners = { [k in ExitEvent]: Handler[] }

// teeny special purpose ee
class Emitter {
  emitted: Emitted = {
    afterExit: false,
    exit: false,
  }

  listeners: Listeners = {
    afterExit: [],
    exit: [],
  }

  count: number = 0
  id: number = Math.random()

  constructor() {
    if (global[kExitEmitter]) {
      return global[kExitEmitter]
    }
    ObjectDefineProperty(global, kExitEmitter, {
      value: this,
      writable: false,
      enumerable: false,
      configurable: false,
    })
  }

  on(ev: ExitEvent, fn: Handler) {
    this.listeners[ev].push(fn)
  }

  removeListener(ev: ExitEvent, fn: Handler) {
    const list = this.listeners[ev]
    const i = list.indexOf(fn)
    /* c8 ignore start */
    if (i === -1) {
      return
    }
    /* c8 ignore stop */
    if (i === 0 && list.length === 1) {
      list.length = 0
    } else {
      list.splice(i, 1)
    }
  }

  emit(
    ev: ExitEvent,
    code: number | null | undefined,
    signal: NodeJS.Signals | null
  ): boolean {
    if (this.emitted[ev]) {
      return false
    }
    this.emitted[ev] = true
    let ret: boolean = false
    for (const fn of this.listeners[ev]) {
      ret = fn(code, signal) === true || ret
    }
    if (ev === 'exit') {
      ret = this.emit('afterExit', code, signal) || ret
    }
    return ret
  }
}

abstract class SignalExitBase {
  abstract onExit(cb: Handler, opts?: { alwaysLast?: boolean }): () => void
  abstract load(): void
  abstract unload(): void
}

const signalExitWrap = <T extends SignalExitBase>(handler: T) => {
  return {
    onExit(cb: Handler, opts?: { alwaysLast?: boolean }) {
      return handler.onExit(cb, opts)
    },
    load() {
      return handler.load()
    },
    unload() {
      return handler.unload()
    },
  }
}

class SignalExitFallback extends SignalExitBase {
  onExit() {
    return () => {}
  }
  load() {}
  unload() {}
}

class SignalExit extends SignalExitBase {
  // "SIGHUP" throws an `ENOSYS` error on Windows,
  // so use a supported signal instead
  /* c8 ignore start */
  #hupSig = process.platform === 'win32' ? 'SIGINT' : 'SIGHUP'
  /* c8 ignore stop */
  #emitter = new Emitter()
  #process: ProcessRE
  #originalProcessEmit: ProcessRE['emit']
  #originalProcessReallyExit: ProcessRE['reallyExit']

  #sigListeners: { [k in NodeJS.Signals]?: () => void } = {}
  #loaded: boolean = false

  constructor(process: ProcessRE) {
    super()
    this.#process = process
    // { <signal>: <listener fn>, ... }
    this.#sigListeners = {}
    for (const sig of signals) {
      this.#sigListeners[sig] = () => {
        // If there are no other listeners, an exit is coming!
        // Simplest way: remove us and then re-send the signal.
        // We know that this will kill the process, so we can
        // safely emit now.
        const listeners = this.#process.listeners(sig)
        let { count } = this.#emitter
        // This is a workaround for the fact that signal-exit v3 and signal
        // exit v4 are not aware of each other, and each will attempt to let
        // the other handle it, so neither of them do. To correct this, we
        // detect if we're the only handler *except* for previous versions
        // of signal-exit, and increment by the count of listeners it has
        // created.
        /* c8 ignore start */
        const p = process as unknown as {
          __signal_exit_emitter__?: { count: number }
        }
        if (
          typeof p.__signal_exit_emitter__ === 'object' &&
          typeof p.__signal_exit_emitter__.count === 'number'
        ) {
          count += p.__signal_exit_emitter__.count
        }
        /* c8 ignore stop */
        if (listeners.length === count) {
          this.unload()
          const ret = this.#emitter.emit('exit', null, sig)
          /* c8 ignore start */
          const s = sig === 'SIGHUP' ? this.#hupSig : sig
          if (!ret) process.kill(process.pid, s)
          /* c8 ignore stop */
        }
      }
    }

    this.#originalProcessReallyExit = process.reallyExit
    this.#originalProcessEmit = process.emit
  }

  onExit(cb: Handler, opts?: { alwaysLast?: boolean }) {
    /* c8 ignore start */
    if (!processOk(this.#process)) {
      return () => {}
    }
    /* c8 ignore stop */

    if (this.#loaded === false) {
      this.load()
    }

    const ev = opts?.alwaysLast ? 'afterExit' : 'exit'
    this.#emitter.on(ev, cb)
    return () => {
      this.#emitter.removeListener(ev, cb)
      if (
        this.#emitter.listeners['exit'].length === 0 &&
        this.#emitter.listeners['afterExit'].length === 0
      ) {
        this.unload()
      }
    }
  }

  load() {
    if (this.#loaded) {
      return
    }
    this.#loaded = true

    // This is the number of onSignalExit's that are in play.
    // It's important so that we can count the correct number of
    // listeners on signals, and don't wait for the other one to
    // handle it instead of us.
    this.#emitter.count += 1

    for (const sig of signals) {
      try {
        const fn = this.#sigListeners[sig]
        if (fn) this.#process.on(sig, fn)
      } catch (_) {}
    }

    this.#process.emit = (ev: string, ...a: any[]) => {
      return this.#processEmit(ev, ...a)
    }
    this.#process.reallyExit = (code?: number | null | undefined) => {
      return this.#processReallyExit(code)
    }
  }

  unload() {
    if (!this.#loaded) {
      return
    }
    this.#loaded = false

    signals.forEach(sig => {
      const listener = this.#sigListeners[sig]
      /* c8 ignore start */
      if (!listener) {
        throw new Error('Listener not defined for signal: ' + sig)
      }
      /* c8 ignore stop */
      try {
        this.#process.removeListener(sig, listener)
        /* c8 ignore start */
      } catch (_) {}
      /* c8 ignore stop */
    })
    this.#process.emit = this.#originalProcessEmit
    this.#process.reallyExit = this.#originalProcessReallyExit
    this.#emitter.count -= 1
  }

  #processReallyExit(code?: number | null | undefined) {
    /* c8 ignore start */
    if (!processOk(this.#process)) {
      return 0
    }
    this.#process.exitCode = code || 0
    /* c8 ignore stop */

    this.#emitter.emit('exit', this.#process.exitCode, null)
    return this.#originalProcessReallyExit.call(
      this.#process,
      this.#process.exitCode
    )
  }

  #processEmit(ev: string, ...args: any[]): any {
    const og = this.#originalProcessEmit
    if (ev === 'exit' && processOk(this.#process)) {
      if (typeof args[0] === 'number') {
        this.#process.exitCode = args[0]
        /* c8 ignore start */
      }
      /* c8 ignore start */
      const ret = og.call(this.#process, ev, ...args)
      /* c8 ignore start */
      this.#emitter.emit('exit', this.#process.exitCode, null)
      /* c8 ignore stop */
      return ret
    } else {
      return og.call(this.#process, ev, ...args)
    }
  }
}

const process = globalThis.process
// wrap so that we call the method on the actual handler, without
// exporting it directly.
export const {
  /**
   * Called when the process is exiting, whether via signal, explicit
   * exit, or running out of stuff to do.
   *
   * If the global process object is not suitable for instrumentation,
   * then this will be a no-op.
   *
   * Returns a function that may be used to unload signal-exit.
   */
  onExit,

  /**
   * Load the listeners.  Likely you never need to call this, unless
   * doing a rather deep integration with signal-exit functionality.
   * Mostly exposed for the benefit of testing.
   *
   * @internal
   */
  load,

  /**
   * Unload the listeners.  Likely you never need to call this, unless
   * doing a rather deep integration with signal-exit functionality.
   * Mostly exposed for the benefit of testing.
   *
   * @internal
   */
  unload,
} = signalExitWrap(
  processOk(process) ? new SignalExit(process) : new SignalExitFallback()
)
